from typing import List


def concatenate(strings: List[str]) -> str:
    """ Concatenate list of strings into a single string
    >>> concatenate([])
    ''
    >>> concatenate(['a', 'b', 'c'])
    'abc'
    """
    if isinstance(strings, str):
        return''.join(strings)
    elif isinstance(strings, List[str]):
        return''.join([strings[j] for j in strings])
    else:
        raise TypeError('Wrong type of strings')

